import React, { Fragment } from 'react';
import AppMap from './Appmap';

const Appass = (props) => {
  console.log(props.TodoPass);
    return (
      <Fragment>
      <section>
         {
              props.TodoPass.map((todo) => (
                <AppMap 
                key={todo.id} 
                todoapp={todo.todo} 
                id={todo.id} 
                />
              ))}
      </section>
  </Fragment>
    );
};
export default Appass;
